@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

atm:ATM a owl:Class .
atm:Money a owl:Class .
atm:Withdrawal a owl:Class .
atm:Bank a owl:Class .

atm:dispenses a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Money .

atm:processes a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Withdrawal .

atm:accepts a owl:ObjectProperty ;
  rdfs:domain atm:Bank ;
  rdfs:range atm:Withdrawal .

atm:Withdrawal a owl:Class ;
  rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:dispenses ;
    owl:someValuesFrom atm:Money
  ] , [
    a owl:Restriction ;
    owl:onProperty atm:processes ;
    owl:someValuesFrom atm:ATM
  ] , [
    a owl:Restriction ;
    owl:onProperty atm:accepts ;
    owl:someValuesFrom atm:Bank
  ] .
